import React, {useEffect,useState} from 'react';
import About from "../components/about.js"
import ProjectLink from "../components/project_link.js"
import axios from 'axios';

function Home() {
  const [data, setData] = useState([]);
  //----------------------Getting the data from my backend
  useEffect(() => {
    axios.get('https://tranquil-brushlands-15503.herokuapp.com/')
    .then(function (response) {
      console.log("response",response.data.data);
      setData(response);
      console.log("data",data);    
    })
    .catch(function (error) {
      console.log(error);
    });
  }, []);
  console.log("data after axios",data);
  return (
    <div className="home">
      <About/>
      <section className = "projects_home">
        {data.map((project, i) => (
          <div> Tester</div>
        ))}
      </section>      
    </div>
  );
}

export default Home;
